import React from "react";
import TournamentForm from "../components/Form/form";
import Navbar from "../components/Navbar/navbar";

function Home() {
  return (
    <Container>
      <Row>
        <Navbar></Navbar>
      </Row>
      <Row>
      <Col xs={{ span: 6, offset: 3 }}><TournamentForm/></Col>
      </Row>
    </Container>
  );
}

export default Home;
